(8, 'FitStride', 'fitstride', 904, 904, 'FitStride Athletic Footwear', 'FitStride is a leading brand in athletic footwear. Designed for both casual and professional athletes, our shoes offer maximum comfort, performance, and style. Step up your game with FitStri...', NULL, '2023-11-18 11:53:51', NULL),
(9, 'LuxeDrape', 'luxedrape', 905, 905, 'LuxeDrape Fashion Line', 'LuxeDrape brings luxury to your wardrobe with a collection of sophisticated attire. Our pieces are timeless, and our designs merge both classic and contemporary styles. Dress in elegance wit...', NULL, '2023-11-18 11:53:34', NULL),
(10, 'MunchDelight', 'munchdelight', 906, 906, 'MunchDelight Gourmet Snacks', 'MunchDelight is your destination for gourmet snacks and treats. Made with the finest ingredients, our products offer a unique taste sensation. Indulge in the deliciousness of MunchDelight.', NULL, '2023-11-18 11:53:15', NULL),
