pun loose face powder. Use to set contouring and highlights, or to help conceal and reduce the look of rough skin, fine lines, wrinkles, skin blemishes and help correct uneven skin tones', NULL, 'awesome , face , power', 'Hide lines and wrinkles: Coty Airspun face powder in translucent extra coverage is a loose face and setting powder that helps to minimize the appearance of fine lines, wrinkles, acne, scars and other blemishes, giving your facial skin a smoother, softer lookFoundation or setting powder: Coty Airspun face powder can be used to help smooth and soften the appearance of your skin as a foundation coverage, or use the loose powder on top of your makeup as a setting powder so you can get that flawless, smooth lookLightweight long lasting coverage: Airspun Loose Face Powder is long lasting and helps give full coverage that feels lightweight enough to wear all day. This face powder can be used as a foundation or setting powder and helps your face look smooth and flawlessFlawless finish: Get the flawless finish you want with the help of Airspun loose face powder. Use to set contouring and highlights, or to help conceal and reduce the look of rough skin, fine lines, wrinkles, skin blemishes and help correct uneven skin tones', NULL, '2023-10-31 05:55:13', '2023-10-31 05:55:13'),
