(3, 'About Us', 'about', NULL, NULL, '<div class=\"col-lg-8 about-area__wrap__left\">\r\n\r\n            <h3>The Muslin: Weaving Traditions into Modern Elegance</h3>\r\n            <div class=\"row\">\r\n              <div class=\"col-lg-6 about-area__wrap__left__text\">\r\n                <p>\r\n                  Established in 2021, The Muslin stands as a cherished brand\r\n                  and proud sister concern of IconX Lifestyle Limited,\r\n                  reflecting a profound dedication to preserving and showcasing\r\n                  the rich heritage of Bangladesh. Situated at the prestigious\r\n                  Le Meridien Dhaka, on the Entresol (Lobby floor) of 79/A\r\n                  Commercial Area, Airport Road, Nikunja-2, Dhaka-1229, The\r\n                  Muslin is not merely a brand but a tribute to the artistry,\r\n                  culture, and history of the nation. IconX Lifestyle Limited is\r\n                  a part Best Holdings Ltd. which stands as a trailblazer in\r\n                  Bangladesh\'s dynamic construction sector, playing a pivotal\r\n                  role in the country\'s overarching infrastructure development.\r\n                </p>\r\n              </div>\r\n              <div class=\"col-lg-6\">\r\n                <p>\r\n                  Diving further into its portfolio, BHL is proud to present\r\n                  projects of extraordinary significance. These include the\r\n                  magnificent Marriott Bhaluka, a 228-room upper upscale hotel\r\n                  affiliated with Marriott International, USA. The Muslin, a\r\n                  Luxury Collection Resort in Bhaluka, stands as a testament to\r\n                  BHL\'s commitment to crafting opulent spaces. Moreover, through\r\n                  a strategic partnership with Haileybury UK, one of the world\'s\r\n                  esteemed independent schools, BHL is engaged in the\r\n                  development of Haileybury Bhaluka, showcasing the company\'s\r\n                  versatility beyond construction.\r\n                </p>\r\n              </div>\r\n            </div>\r\n            <h3 class=\"second-title\">\r\n              Empowering Weavers: A Platform for Artisans\r\n            </h3>\r\n            <p>\r\n              At the heart of The Muslin\'s ethos lies a commitment to the\r\n              weavers and artisans who contribute to its opulent offerings. It\r\n              proudly provides a platform for local weavers, giving them a voice\r\n              and recognition for their art. By creating an avenue for these\r\n              skilled craftsmen and women, The Muslin plays a pivotal role in\r\n              sustaining the livelihoods of these artists while enriching the\r\n              broader cultural landscape.\r\n            </p>\r\n          </div>\r\n\r\n          <div class=\"col-lg-4 about-area__wrap__right\">\r\n            <div class=\"about-area__wrap__right__img\">\r\n              <img class=\"modify-img\" data-image-small=\"/assets/images/dynamic/about/about.jpg\" data-image-large=\"/assets/images/dynamic/about/about.jpg\" data-image-standard=\"/assets/images/dynamic/about/about.jpg\" data-src=\"\" src=\"assets/images/static/blur.jpg\" alt=\"\">\r\n            </div>\r\n          </div>', 'publish', 'all', 0, 0, '2024-01-02 00:20:38', '2024-01-02 00:43:05', '0', '0', '0'),
