d) the link is in the context of general resource information.\r\n</span></p><p><span style=\"font-weight: normal;\">These organizations may link to our home page so long as the link: (a) is not in any way deceptive; (b) does not falsely imply sponsorship, endorsement or approval of the linking party and its products or services; and (c) fits within the context of the linking party’s site.\r\n</span></p><p><span style=\"font-weight: normal;\">If you are one of the organizations listed in paragraph 2 above and are interested in linking to our website, you must inform us by sending an e-mail to Zaika. Please include your name, your organization name, contact information as well as the URL of your site, a list of any URLs from which you intend to link to our Website, and a list of the URLs on our site to which you would like to link. Wait 2-3 weeks for a response.\r\n</span></p><p><span style=\"font-weight: normal;\">Approved organizations may hyperlink to our Website as follows:\r\n</span></p><p><span style=\"font-weight: normal;\">By use of our corporate name; or\r\n</span></p><p><span style=\"font-weight: normal;\">By use of the uniform resource locator being linked to; or\r\n</span></p><p><span style=\"font-weight: normal;\">By use of any other description of our Website being linked to that makes sense within the context and format of content on the linking party’s site.\r\n</span></p><p><span style=\"font-weight: normal;\">No use of Zaika\'s logo or other artwork will be allowed for linking absent a trademark license agreement.\r\n</span></p><p><span style=\"font-weight: normal;\">iFrames\r\n</span></p><p><span style=\"font-weight: normal;\">Without prior approval and written permission, you may not create frames around our Webpages that alter in any way the visual presentation or appearance of our Website.\r\n</span></p><p><span style=\"font-weight: normal;\">Content Liability\r\n</span></p><p><span style=\"font-weight: normal;\">We shall not be hold responsible