(70, 'TextSectionStyleOne', 'update', 'dynamic_page', NULL, 2, 'dynamic_page', 'a:12:{s:2:\"id\";s:2:\"70\";s:10:\"addon_name\";s:19:\"TextSectionStyleOne\";s:15:\"addon_namespace\";s:68:\"QXBwXFBhZ2VCdWlsZGVyXEFkZG9uc1xDb21tb25cVGV4dFNlY3Rpb25TdHlsZU9uZQ==\";s:10:\"addon_type\";s:6:\"update\";s:14:\"addon_location\";s:12:\"dynamic_page\";s:11:\"addon_order\";N;s:13:\"addon_page_id\";s:1:\"2\";s:15:\"addon_page_type\";s:12:\"dynamic_page\";s:12:\"section_text\";s:8764:\"<p><span style=\"font-weight: normal;\">At </span>Zaika<span style=\"font-weight: normal;\">, accessible from zaika.com, one of our main priorities is the privacy of our visitors. This Privacy Policy document contains types of information that is collected and recorded by Zaika and how we use it.\r\n</span></p><p>\r\n</p><p><span style=\"font-weight: normal;\">If you have additional questions or require more information about our Privacy Policy, do not hesitate to contact us.\r\n</span></p><p><span style=\"font-weight: normal;\">This Privacy Policy applies only to our online activities and is valid for visitors to our website with regards to the information that they shared and/or collect in Zaika. This policy is not applicable to any information collected offline or via channels other than this website. Our Privacy Policy was created with the help of the Free Privacy Policy Generator.\r\n</span></p><p><span style=\"font-weight: normal;\">Consent\r\n</span></p><p><span style=\"font-weight: normal;\">By using our website, you hereby consent to our Privacy Policy and agree to its terms.\r\n</span></p><p><span style=\"font-weight: normal;\">Information we collect\r\n</span></p><p><span style=\"font-weight: normal;\">The personal information that you are asked to provide, and the reasons why you are asked to provide it, will be made clear to you at the point we ask you to provide your personal information.\r\n</span></p><p><span style=\"font-weight: normal;\">If you contact us directly, we may receive additional information about you such as your name, email address, phone number, the contents of the message and/or attachments you may send us, and any other information you may choose to provide.\r\n</span></p><p><span style=\"font-weight: normal;\">When you register for an Account, we may ask for your contact information, including items such as name, company name, address, email address, and telephone number.\r\n</span></p><p><span style=\"font-weight: normal;\">How we use your information\r\n</span></p><p><span style=\"font-weight: normal;\">We use the information we collect in various ways, including to:\r\n</span></p><p><span style=\"font-weight: normal;\">Provide, operate, and maintain our website\r\n</span></p><p><span style=\"font-weight: normal;\">Improve, personalize, and expand our website\r\n</span></p><p><span style=\"font-weight: normal;\">Understand and analyze how you use our website\r\n</span></p><p><span style=\"font-weight: normal;\">Develop new products, services, features, and functionality\r\n</span></p><p><span style=\"font-weight: normal;\">Communicate with you, either directly or through one of our partners, including for customer service, to provide you with updates and other information relating to the website, and for marketing and promotional purposes\r\n</span></p><p><span style=\"font-weight: normal;\">Send you emails\r\n</span></p><p><span style=\"font-weight: normal;\">Find and prevent fraud\r\n</span></p><p><span style=\"font-weight: normal;\">Log Files\r\n</span></p><p><span style=\"font-weight: normal;\">Zaika follows a standard procedure of using log files. These files log visitors when they visit websites. All hosting companies do this and a part of hosting services\' analytics. The information collected by log files include internet protocol (IP) addresses, browser type, Internet Service Provider (ISP), date and time stamp, referring/exit pages, and possibly the number of clicks. These are not linked to any information that is personally identifiable. The purpose of the information is for analyzing trends, administering the site, tracking users\' movement on the website, and gathering demographic information.\r\n</span></p><p><span style=\"font-weight: normal;\">Advertising Partners Privacy Policies\r\n</span></p><p><span style=\"font-weight: normal;\">You may consult this list to find the Privacy Policy for each of the advertising partners of Zaika.\r\n</span></p><p><span style=\"font-weight: normal;\">Third-party ad servers or ad networks uses technologies like cookies, JavaScript, or Web Beacons that are used in their respective advertisements and links that appear on Zaika, which are sent directly to users\' browser. They automatically receive your IP address when this occurs. These technologies are used to measure the effectiveness of their advertising campaigns and/or to personalize the advertising content that you see on websites that you visit.\r\n</span></p><p><span style=\"font-weight: normal;\">Note that Zaika has no access to or control over these cookies that are used by third-party advertisers.\r\n</span></p><p><span style=\"font-weight: normal;\">Third Party Privacy Policies\r\n</span></p><p><span style=\"font-weight: normal;\">Zaika\'s Privacy Policy does not apply to other advertisers or websites. Thus, we are advising you to consult the respective Privacy Policies of these third-party ad servers for more detailed information. It may include their practices and instructions about how to opt-out of certain options.\r\n</span></p><p><span style=\"font-weight: normal;\">You can choose to disable cookies through your individual browser options. To know more detailed information about cookie management with specific web browsers, it can be found at the browsers\' respective websites.\r\n</span></p><p><span style=\"font-weight: normal;\">CCPA Privacy Rights (Do Not Sell My Personal Information)\r\n</span></p><p><span style=\"font-weight: normal;\">Under the CCPA, among other rights, California consumers have the right to:\r\n</span></p><p><span style=\"font-weight: normal;\">Request that a business that collects a consumer\'s personal data disclose the categories and specific pieces of personal data that a business has collected about consumers.\r\n</span></p><p><span style=\"font-weight: normal;\">Request that a business delete any personal data about the consumer that a business has collected.\r\n</span></p><p><span style=\"font-weight: normal;\">Request that a business that sells a consumer\'s personal data, not sell the consumer\'s personal data.\r\n</span></p><p><span style=\"font-weight: normal;\">If you make a request, we have one month to respond to you. If you would like to exercise any of these rights, please contact us.\r\n</span></p><p><span style=\"font-weight: normal;\">GDPR Data Protection Rights\r\n</span></p><p><span style=\"font-weight: normal;\">We would like to make sure you are fully aware of all of your data protection rights. Every user is entitled to the following:\r\n</span></p><p><span style=\"font-weight: normal;\">The right to access – You have the right to request copies of your personal data. We may charge you a small fee for this service.\r\n</span></p><p><span style=\"font-weight: normal;\">The right to rectification – You have the right to request that we correct any information you believe is inaccurate. You also have the right to request that we complete the information you believe is incomplete.\r\n</span></p><p><span style=\"font-weight: normal;\">The right to erasure – You have the right to request that we erase your personal data, under certain conditions.\r\n</span></p><p><span style=\"font-weight: normal;\">The right to restrict processing – You have the right to request that we restrict the processing of your personal data, under certain conditions.\r\n</span></p><p><span style=\"font-weight: normal;\">The right to object to processing – You have the right to object to our processing of your personal data, under certain conditions.\r\n</span></p><p><span style=\"font-weight: normal;\">The right to data portability – You have the right to request that we transfer the data that we have collected to another organization, or directly to you, under certain conditions.\r\n</span></p><p><span style=\"font-weight: normal;\">If you make a request, we have one month to respond to you. If you would like to exercise any of these rights, please contact us.\r\n</span></p><p><span style=\"font-weight: normal;\">Children\'s Information\r\n</span></p><p><span style=\"font-weight: normal;\">Another part of our priority is adding protection for children while using the internet. We encourage parents and guardians to observe, participate in, and/or monitor and guide their online activity.\r\n</span></p><p><span style=\"font-weight: normal;\">Zaika does not knowingly collect any Personal Identifiable Information from children under the age of 13. If you think that your child provided this kind of information on our website, we strongly encourage you to contact us immediately and we will do our best efforts to promptly remove such information from our records.</span></p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p>\";s:17:\"summer_note_image\";N;s:11:\"padding_top\";s:3:\"120\";s:14:\"padding_bottom\";s:3:\"120\";}', 'App\\PageBuilder\\Addons\\Common\\TextSectionStyleOne', '2021-11-21 00:56:15', '2021-11-21 00:56:16'),
